import React, { useState } from "react";
import { useDispatch } from "react-redux";
import { getUserbyCode } from "../../Redux/actions";
import { setSession } from '../../Redux/actions';
import styles from "../StyleSheet/Login.module.css";
import Swal from 'sweetalert2';
import 'sweetalert2/dist/sweetalert2.min.css';


function Login() {
  const [code, setCode] = useState("");
  const dispatch = useDispatch();

  const handleCodeChange = (event) => {
    setCode(event.target.value);
  };
  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      const response = await dispatch(getUserbyCode(code));
      if (response && response.length > 0) {
        const user = response[0];
        dispatch(setSession(user));
        Swal.fire({
          icon: 'success',
          title: 'Inicio de sesión exitoso',
          showConfirmButton: false,
          timer: 1800
        });
      } else {
        console.error('Response object is not defined or does not contain payload');
      }
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <div className={styles["login-container"]}>
        <label htmlFor="code">Ingresa tu código:</label>
        <input type="text" id="code" value={code} onChange={handleCodeChange} />
      </div>
      <button className={styles["login-button"]} type="submit">
        Ingresar
      </button>
    </form>
  );
}

export default Login;
